import React, { useState, useEffect } from 'react';
import { useNavigate, useParams } from 'react-router-dom';

import Stack from '@mui/material/Stack';

import Card from '../components/card';
import FormGroup from '../components/form-group';

import { mensagemSucesso, mensagemErro } from '../components/toastr';

import '../custom.css';

import axios from 'axios';
import { BASE_URL } from '../config/axios';

function CadastroEstoques() {
	const { idParam } = useParams();

	const navigate = useNavigate();

	const baseURL = `${BASE_URL}jsonfake2/cargos`;

	const [id, setId] = useState('');
	const [quantidade, setQuantidade] = useState(0);
	const [produto, setProduto] = useState(null);
	const [dataFabricacao, setDataFabricacao] = useState('');
	const [dataValidade, setDataValidade] = useState('');
	const [farmacia, setFarmacia] = useState(null);

	const [dados, setDados] = useState([]);

	const [listaFarmacias, setListaFarmacias] = useState([]);
	const [listaProdutos, setListaProdutos] = useState([]);

	//const [listaPermissoes, setListaPermissoes] = useState([]);



	function inicializar() {
		if (idParam == null) {
			setId('');
			setQuantidade(0);
			setProduto(null);
			setDataFabricacao('');
			setDataValidade('');
			setFarmacia(null);
		} else {
			setId(dados.id);
			setQuantidade(dados.quantidade);
			setProduto(dados.produto);
			setDataFabricacao(dados.dataFabricacao);
			setDataValidade(dados.dataValidade);
			setFarmacia(dados.farmacia);
		}
	}

	async function salvar() {
		let data = { id, quantidade, produto, dataFabricacao, dataValidade, farmacia };
		data = JSON.stringify(data);
		if (idParam == null) {
			await axios
				.post(baseURL, data, {
					headers: { 'Content-Type': 'application/json' },
				}) 
				.then(function (response) {
					mensagemSucesso(`Estoque ${produto.nome + dataFabricacao} cadastrado com sucesso!`);
					navigate(`/listagem-estoques`);
				})
				.catch(function (error) {
					mensagemErro(error.response.data);
				});
		} else {
			await axios
				.put(`${baseURL}/${idParam}`, data, {
					headers: { 'Content-Type': 'application/json' },
				})
				.then(function (response) {
					mensagemSucesso(`Estoque ${produto.nome + dataFabricacao} alterado com sucesso!`);
					navigate(`/listagem-estoques`);
				})
				.catch(function (error) {
					mensagemErro(error.response.data);
				});
		}
	}


	async function buscar() {
		if (idParam != null) {
			await axios.get(`${baseURL}/${idParam}`).then((response) => {
				setDados(response.data);
			}).catch((a) => {
				console.log(a);
			});
			setId(dados.id);
			setQuantidade(dados.quantidade);
			setProduto(dados.produto);
			setDataFabricacao(dados.dataFabricacao);
			setDataValidade(dados.dataValidade);
			setFarmacia(dados.farmacia);
		}
		await axios.get(`${BASE_URL}/jsonfake3/permissoes`).then((response) => {
            setListaPermissoes(response.data);
        }).catch((a) => {
            //console.log(a);
        });
	}

	useEffect(() => {
		buscar(); // eslint-disable-next-line
	}, [id]);

	if (!dados) return null;

	return (
		<div className='container'>
			<Card title='Cadastro de Cargo'>
				<div className='row'>
					<div className='col-lg-12'>
						<div className='bs-component'>
							<FormGroup label='Nome: *' htmlFor='inputNome'>
								<input
									type='text'
									id='inputNome'
									value={nome}
									className='form-control'
									name='nome'
									onChange={(e) => setNome(e.target.value)}
								/>
							</FormGroup>
							<FormGroup label='Permissoes: *' htmlFor='inputPermissoes'>
                                <select
                                    //type='text'
                                    id='inputPermissoes'
                                    value={permissoes}
                                    className='form-control'
                                    name='permissoes'
                                    onChange={(e) => setPermissoes(e.target.value)}
									multiple
                                >
                                    {listaPermissoes.map((cat) => (
                                        <option value={cat.id} key={cat.id}>{cat.nome}</option>
                                    ))}
                                </select>

                            </FormGroup>

							<Stack spacing={1} padding={1} direction='row'>
								<button
									onClick={salvar}
									type='button'
									className='btn btn-success'
								>
									Salvar
								</button>
								<button
									onClick={inicializar}
									type='button'
									className='btn btn-danger'
								>
									Cancelar
								</button>
							</Stack>
						</div>
					</div>
				</div>
			</Card>
		</div>
	);
}

export default CadastroEstoques;
